import React, { useState } from 'react';

function AddProject() {
  // Sample categories data
  const categories = [
    { id: 1, name: 'Web Development', icon: '🌐', description: 'Websites and web applications', count: 12 },
    { id: 2, name: 'Mobile Development', icon: '📱', description: 'iOS and Android applications', count: 8 },
    { id: 3, name: 'UI/UX Design', icon: '🎨', description: 'User interface and experience design', count: 15 },
    { id: 4, name: 'Data Science', icon: '📊', description: 'Data analysis and machine learning', count: 6 },
    { id: 5, name: 'DevOps', icon: '⚙️', description: 'Infrastructure and deployment', count: 4 },
    { id: 6, name: 'Marketing', icon: '📈', description: 'Digital marketing and SEO', count: 10 },
    { id: 7, name: 'Content Creation', icon: '✍️', description: 'Writing and content management', count: 7 },
    { id: 8, name: 'E-commerce', icon: '🛒', description: 'Online stores and shopping platforms', count: 9 },
  ];

  const [selectedCategory, setSelectedCategory] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');

  const filteredCategories = categories.filter(category =>
    category.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
    category.description.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleCategorySelect = (category) => {
    setSelectedCategory(category);
    // Here you can add navigation to the project creation form
    console.log('Selected category:', category);
  };

  return (
    <div className="flex flex-col w-full min-h-screen space-y-6 p-6">
      {/* Header */}
      <div className="bg-white rounded-xl shadow p-6">
        <div className="flex items-center justify-between mb-4">
          <div>
            <h1 className="text-2xl font-bold text-gray-800">Add New Project</h1>
            <p className="text-gray-600 mt-1">Choose a category for your project</p>
          </div>
          <button 
            onClick={() => window.history.back()}
            className="px-4 py-2 text-gray-600 hover:text-gray-800 transition-colors"
          >
            ← Back
          </button>
        </div>

        {/* Search Bar */}
        <div className="relative">
          <input
            type="text"
            placeholder="Search categories..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full px-4 py-3 pl-10 border border-gray-300 rounded-lg focus:ring-2 focus:ring-purple-500 focus:border-transparent"
          />
          <span className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400">
            🔍
          </span>
        </div>
      </div>

      {/* Categories Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
        {filteredCategories.map((category) => (
          <div
            key={category.id}
            onClick={() => handleCategorySelect(category)}
            className="bg-white rounded-xl shadow p-6 cursor-pointer hover:shadow-lg transition-all duration-200 hover:scale-105 border-2 border-transparent hover:border-purple-200"
          >
            <div className="flex items-center justify-between mb-4">
              <span className="text-3xl">{category.icon}</span>
              <span className="text-sm text-gray-500 bg-gray-100 px-2 py-1 rounded-full">
                {category.count} projects
              </span>
            </div>
            <h3 className="text-lg font-semibold text-gray-800 mb-2">
              {category.name}
            </h3>
            <p className="text-gray-600 text-sm mb-4">
              {category.description}
            </p>
            <div className="flex items-center text-purple-600 text-sm font-medium">
              Select Category →
            </div>
          </div>
        ))}
      </div>

      {/* No Results */}
      {filteredCategories.length === 0 && (
        <div className="bg-white rounded-xl shadow p-12 text-center">
          <span className="text-4xl mb-4 block">🔍</span>
          <h3 className="text-xl font-semibold text-gray-800 mb-2">No categories found</h3>
          <p className="text-gray-600">Try adjusting your search terms</p>
        </div>
      )}

      {/* Selected Category Modal */}
      {selectedCategory && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
          <div className="bg-white rounded-xl p-6 max-w-md w-full">
            <div className="flex items-center justify-between mb-4">
              <h3 className="text-xl font-semibold">Selected Category</h3>
              <button
                onClick={() => setSelectedCategory(null)}
                className="text-gray-500 hover:text-gray-700"
              >
                ✕
              </button>
            </div>
            <div className="flex items-center mb-4">
              <span className="text-2xl mr-3">{selectedCategory.icon}</span>
              <div>
                <h4 className="font-semibold">{selectedCategory.name}</h4>
                <p className="text-gray-600 text-sm">{selectedCategory.description}</p>
              </div>
            </div>
            <div className="flex gap-3">
              <button
                onClick={() => setSelectedCategory(null)}
                className="flex-1 px-4 py-2 border border-gray-300 rounded-lg text-gray-700 hover:bg-gray-50"
              >
                Cancel
              </button>
              <button
                onClick={() => {
                  // Here you would navigate to the project creation form
                  console.log('Creating project for category:', selectedCategory);
                  setSelectedCategory(null);
                }}
                className="flex-1 px-4 py-2 bg-purple-600 text-white rounded-lg hover:bg-purple-700"
              >
                Create Project
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default AddProject;
